    "2013-03-15T11:20:30.315553",nt"name": "orthorectified-photomosaic-for-walnut-canyon-national-monument-vegetation-mapping-project",nt"isopen":
    false,nt"url": null,nt"notes": "Orthophotos combine the image characteristics
    of a photograph with the geometric qualities of a map. The primary digital orthophotoquad
    (DOQ) is a 1-meter ground resolution, quarter-quadrangle (3.75-minutes of latitude
    by 3.75-minutes of longitude) image cast on the Universal Transverse Mercator Projection
    (UTM) on the North American Datum of 1983 (NAD83).The geographic extent of the DOQ
    is equivalent to a quarter-quad plus The overedge ranges a minimum of 50 meters
    to a maximum of 300 meters beyond the extremes of the primary and secondary corner
    points. The overedge is included to facilitate tonal matching for mosaicking and
    for the placement of the NAD83 and secondary datum corner ticks. The normal orientation
    of data is by lines (rows) and samples (columns). Each line contains a series of
    pixels ordered from west to east with the order of the lines from north to south.
    The standard, archived digital orthophoto is formatted as four ASCII header records,
    followed by a series of 8-bit binary image data records. The radiometric image brightness
    values are stored as 256 gray levels ranging from 0 to 255. The metadata provided
    in the digital orthophoto contain a wide range of descriptive information including
    format source information, production instrumentation and dates, and data to assist
    with displaying and georeferencing the image. The standard distribution format of
    DOQs will be JPEG compressed images on CD-ROM by counties or special regions. The
    reconstituted image from the CD-ROM will exhibit some radiometric differences when
    compared to its uncompressed original but will retain the geometry of the uncompressed
    DOQ. Uncompressed DOQs are distributed on tape.",nt"license_title": null,nt"extras":
